INSERT INTO `buildings_data` VALUES (1,'Town hall','At the heart of the town you can find the town hall through which the town grows and flourishes. The smart civil servants, who work here, love to give you information about your local population Every expansion of the town hall increases the maximum number of citizens in this town.',0,0,'townHall'),(2,'Trading port','The port is your gateway to the world. Here you can hire trade ships and ready them for long journeys. You can also receive precious goods from places far away Larger trading ports can load ships faster.',0,1,'port'),(3,'Shipyard','What would an island empire be without its fleet? ?At the shipyard, mighty battle ships are made ready and launched for long journeys over the oceans. May the seven seas tremble before them!? Larger Shipyards can build the ships faster.',4,1,'shipyard'),(4,'Academy','The academy is a sublime place full of knowledge which combines the old traditions with modern technology. The wisest heads of your town await entrance! Consider that every scientist needs his own laboratory which costs money. The larger the academy the more scientists you can employ at the same time.',0,0,'academy'),(5,'Warehouse','A part of your supplies is protected at the warehouse. It keeps mean pillagers, rain, birds and other pests away. The warehouse keeper is also always well informed about your resource storage. Expanding your warehouse allows you to protect more supplies',2,0,'warehouse'),(6,'Barracks','In the barracks the boisterous youth is instructed to become keen fighters. Your soldiers know how to handle swords, spears and catapults and are also able to lead the mightiest war machines safely over the field. The troops are instructed faster when you expand your barracks.',0,0,'barracks'),(7,'Town wall','The town wall protects your citizens against your enemies and the sun. Beware! Enemies will try to tear holes into your wall or to climb over it. Every level increases the resistance of your town wall.',0,2,'wall'),(8,'Carpenter','Only the best lumber is used at the carpenter`s workshop. Therefore our handy craftsmen are able to build a solid framework and our houses don`t have to be repaired all the time. Every level of the carpenter`s workshop lowers your demand for building material by 1% of the basic value.',1,0,'carpentering'),(9,'Tavern','After a hard day`s work there is nothing more pleasant than a cool jug of wine. That`s why your citizens love to meet at the tavern. And when the last old songs have been sung at the end of the day, they set out merrily and cheerful to their homes. Every expansion of your tavern allows you to serve more wine.',14,0,'tavern'),(10,'Hideout','A wise leader always has an eye on both his allies and his enemies. The hideout allows you to hire spies who are able to provide you with information from the inside of other towns. A larger hideout provides space for more spies.',11,0,'safehouse'),(11,'Trading Post','Merchants and traders do their business at the trading post. There is always a deal to make or a bargain to hunt. Merchants from far away rather to head for big and well known trading posts! Range and capacity of your trading post are increased with every second expansion.',10,0,'branchOffice'),(12,'Palace','The palace is an excellent place to lead your empire into the future! It also provides a gorgeous view onto the sea. Every expansion of your capital`s palace allows you to set up a further colony.',13,0,'palace'),(13,'Governor`s Residence','A governor in your colony guarantees, that all the daily administrative tasks are done properly. He also lowers the level of corruption in your colony. The governor`s residence can also be upgraded to a palace if you ever want to move your capital.',13,0,'palaceColony'),(14,'Forester\'s House','The strong lumberjacks can chop down even the largest trees. They also know that a forest must be cultivated and new trees must be planted so that we can continue to use only the best wood for our houses. The production of building material is increased by 2% for every level of expansion.',18,0,'forester'),(15,'Winery','A winegrower only chooses the most sunny hills of the surrounding area to cover them with the comforting green of the vines. That`s how the vineyards produce plump fruits that make for a much better harvest. Every level of the winegrower`s expansion increases your wine production by 2%',18,3,'winegrower'),(16,'Stonemason','A trained stonemason always quarries the right blocks of marble with his strong arms. Thus less is broken and our builders always have the material they need. For every level of expansion this building increases the marble production by 2%',18,4,'stonemason'),(17,'Glassblower','True masters of their art create sparkling pieces at the glassblower`s house. The blow tubes, glass and all sorts of other apparatuses are only understood by our scientists. And they are so nimble, that barely anything ever gets broken. Every level of expansion increases your production of crystal glass by 2%',18,5,'glassblowing'),(18,'Alchemist\'s Tower','When the wind blows from the west, a smell fills the streets around the tower and not many citizens are seen leaving the house without a peg on their nose. Our alchemists work restlessly on finding the perfect mixture and ensuring that we can get the maximum amount of sulphur from the pit. For every level of the building your sulphur production is increased by 2%',18,6,'alchemist');
