INSERT INTO `researches` VALUES (1,'Carpentry',1,'The trees from the green forests on our island are strong enough even for our phalanxes` shields. And a strong woodwork can carry the roofs of our buildings. But in order for it to be like that, lumbers must be chosen and handled properly! A carpenter in our town would take care of this and we would use a lot less building material! Allows: Building Carpentries',8,0,0,0,0),(2,'Conservation',2,'We have learned how to store and protect our resources in the long term from wind and weather. Additionally a part of our resources is safe from pirates and other villains, who might want to steal from us! Allows: Building of Warehouses',12,0,0,0,0),(3,'Well construction',3,'Eureka! A well in our settlement! Now we don`t have to wait for it to rain all the time. Our citizens will be much better off and the fields won`t have to be dry for very long! Effect: +50 housing space, +50 happiness in the capital',24,0,0,0,0),(4,'Dry-Dock',4,'A basin close to the sea from which we can drain the water! Now it will be easy to build ships and let them set sail! May a mighty fleet emerge that teaches fear among our enemies! Allows: Building Shipyards',8,0,0,0,0),(5,'Deck Weapons',1,'A rotating attachment for our battle ships on which we can mount huge weapons! For a start our inventors have mounted a huge crossbow on it. But we assume that the attachment will be able to bear other machines, too. So as soon as one of our scientists has an idea we can install it on our ships without a problem. Allows: Building ballista ships in the shipyard',12,1,4,0,0),(6,'Pulley',2,'A brilliant idea: A rope that is pulled over a roll gives a simple man the strength of Hercules. So now our workers can lift up huge blocks of stone on their own and construct our buildings even faster! Effect: 2% less building costs',24,2,0,0,0),(7,'Paper',3,'We have found a better way to archive our knowledge! Now we have scriptures made from the papyrus plant, so we don`t have to chisel our words into the heavy stones anymore in order to fill our library! Effect: 2% more research points',30,3,0,0,0),(8,'Maps',4,'These long marches over the hills and through the swamps mean that our material will wear out very fast. If we write down, how our soldiers can travel over land without always getting stuck in the undergrowth or sinking into the mud, the soldiers will have to mend their uniforms a lot less often. Effect: 2% less upkeep for soldiers',24,4,0,0,0),(9,'Ship maintenance',1,'If we always keep our ships nice and clean, they won`t have to be repaired that often. It will also keep up the morale of the crew when they sing songs together from time to time while scrubbing the deck or mending the sail cloths. Effect: 2% less upkeep for ships',24,5,0,0,0),(10,'Wealth',2,'The earth is full of valuable treasures! We have learned how to mine sulphur and crystal and how to chisel marble off rocks. We are also growing wonderful vines on the fertile land on our hills which produce delicious wine! A new era of prosperity will dawn on us when we start using these treasures. We can then sell goods at a trading post and buy what we need from foreign traders. Effect: Allows the production of trade goods, the construction of trading posts and gives you 130 units of each luxury good.',112,6,0,0,0),(11,'Espionage',3,'When some of our citizens settle down in other towns, they can help us to keep an eye on our neighbours. We could keep ourselves informed when a neighbour makes a discovery or what kind of resources he has in stock. And in the event of war we could also try and have the town gates opened for us. Allows: Building of hideouts',420,7,10,0,0),(12,'Professional Army',4,'Chasing away pirates, barbarians and other villains will be much easier with some professional soldiers! It might be more expensive than just making our citizens into soldiers in the event of war, but in exchange our troops will be able to handle sword, spear and shield much better! Allows: Recruiting of swordsmen and Phalanx at the barracks',336,8,10,0,0),(13,'Expansion',1,'There is a lot more than just an ocean out there! More Islands await being discovery. We are not alone! We can gain ground on one of the newly discovered islands, tap new resources and get to know other nations! And our clerks are eager to administer even more! Allow: Building of palaces, founding of colonies',336,9,10,0,0),(14,'Wine culture',2,'A happy population needs festivals in which they can spend hours revelling and drinking our fantastic free-flowing wine. Dionysos loves seeing us enjoying what he has given us! Allows: Building of taverns',336,3,10,0,0),(15,'Polytheism',3,'Man cannot rationally explain everything that happens in the world. And whenever he cannot explain it, the answer is sought from the gods. Gods are like humans on the one hand, but are very different on the other hand. After all, what other kind of rational explanation can the unexplainable have? Allows: Temples and Miracles',1428,11,12,13,0),(16,'Siege',4,'With a ram`s head made of metal and the strength of ten men we can even tear down town walls. Now it will be easy for our soldiers to conquer other towns! Allows: Building of battering rams in the barracks',1032,11,12,0,0),(17,'Foreign Cultures',1,'If we get to know other nations, it will help us to make progress ourselves. Regular talks and warm exchanges can work true wonders and lead to new alliances and friendships. Of course we need a pretty and comfortable building for all the ambassadors and the feasts we will hold in their honour! Allows: Construction of Embassies',1032,11,13,0,0),(18,'Improved resource gathering',2,'Some time has passed since we learned how to use the treasures of our island for our own needs. We should now educate our workers and let every forest, quarry or vineyard, every sulphur pit or crystal mine be administered by men who are not only strong but also skilful. This way we will gather even more income and our civilization will get richer than ever!',1204,13,14,0,0),(19,'Ink',3,'Nature gives us everything we need to write: The birds give us their feathers and eight-armed fish out of the sea provide us with their black ink! Now we can write down our ideas even more easily! Effect: 4% more research points',2652,15,0,0,0),(20,'Code of Honour',4,'Our soldiers are proud to serve their unit and island empire! And now they also treat their uniforms much more carefully, so that we need to mend and repair a lot less. Effect: 4% less upkeep costs',2236,16,0,0,0),(21,'Pitch',1,'That is some tough and bad smelling liquid our scientists have found there! But since we have started sticking it onto our ships there are hardly any holes we have to mend! Effect: 4% less upkeep for ships',2236,17,0,0,0),(22,'Geometry',2,'Right angles, triangles, circles ? a few bright minds can calculate how we can construct our buildings even better and more beautifully. And soon our towns will serve as examples to the whole world! Effect: 4% less building costs',2236,18,0,0,0),(23,'Invention',3,' 	There has recently been a number of incidents relating to exploding powder and other substances. That`s why we have set up an own workshop for all the nosy scientists, so that all the explosions don`t disturb the work in the academy any more. It also has stronger walls and can`t burn down as easily. Allows: Building of workshops',4320,18,19,0,0),(24,'Ballistics',4,'Now we know how to shoot arrows at our enemies. We should start right now to train our soldiers with these skills, so we can have archers joining our army in battle soon! Allows: Archers',3264,20,0,0,0),(25,'Market',1,'The strangest goods from distant islands arrive on our markets. Here we can also make deals with traders, so we are sure to get all the raw materials we need. Allows: Trade Agreements',3264,18,21,0,0),(26,'Architecture',2,'A good house can withstand the harshest elements. It can withstand them even better when a clever mind takes care of it with a lot of drawings and a little mathematics before hand, so that all the walls are straight and the roof is tight. Thanks to angles and compasses our buildings will be much more stable and well protected from the rain. An architect`s office would spare us a lot of marble, just think about the savings we could make in constructing a new building! Allows: Building of an architect`s office',3672,15,22,0,0),(27,'Cultural Exchange',3,'Our citizens should really have a look at the cultural achievements of other people. And surely, in exchange, they will be interested in learning from us and exhibiting some of our great works of art in their museums. Allows: building of museums',8694,23,0,0,0),(28,'Law of the Lever',4,'With this technology we can unleash powers that can even let huge rocks fly through the air! And if the rocks are large enough, they can even tear down town walls! Allows: Building of catapults in the barracks',7020,23,24,0,0),(29,'Greek Fire',1,'A fire that can`t be extinguished with water! With this mixture from many secret ingredients we can now set fire to ships and sink them! Soon we will conquer the seas with ships that have the breath of a dragon! Allows: Building of flame ships',7020,15,25,0,0),(30,'Relaxation holiday',2,'A worker who has had a good rest is much more eager to work than an exhausted one. That`s why every citizen should have one day off per week. This will make all our citizens happier! Effect: Increases the satisfaction in all towns',7200,26,0,0,0),(31,'Anatomy',3,'We have learned a lot about the human body! Now we can send doctors into battle to help the wounded soldiers to quickly get back on their feet again. Of course they can mix the right tinctures and some doctors even know a secret recipe for a mixture that makes our fighters even braver. Allows: Recruiting of doctors in the Barracks',14952,27,0,0,0),(32,'Governor',4,'If we employ a civil servant, we can then not only pillage another town, but also use and manage it. In no time we will be using the wealth of others for our own gain and will let our own towns rise up with use of their resources. Allows: Occupation',11592,14,28,0,0),(33,'Counterweight',1,'Our scientists have improved the weapon attachment for our ships, so that they don`t tear apart when we fling huge rocks towards our enemies. And thanks to the counterweight our catapult stays on board now and doesn`t launch itself anymore. Allows: Building catapult-ships at the shipyard',9936,26,29,0,0),(34,'Culinary Specialities',2,'Our culture is truly rich in delicious treats! If we have cooks joining our soldiers in battle the delicious smell will be enough to remind them of their kitchen at home and surely strengthen their fighting spirit. And it shouldn`t be forgotten, that a hearty meal has always brought a man back onto his feet. And of course a cook has a sharp knife that he can jump into the fight with. Allows: Training of chefs in the barracks',10764,25,30,0,0),(35,'Optics',3,'When our scientists invent new things, many a glass can break. Or it gets lost in the infinite vastness of our laboratories, as keeping them tidy isn`t really the primal virtue of the academy. If an optician would take care of not only the quality, but also that all the lenses and glasses are put back where they belong, we would use far less crystal glass! Allows: Building of an optician`s',21360,26,31,0,0),(36,'Pyrotechnics',4,'Sulphur is a really is a work of the devil! And with every new mixture, we can get even more impact from this precious resource. A safe practice ground would allow our blasters to test their inventions, without including the surrounding buildings as involuntary targets into their experiments. With better gunpowder and explosives we will save huge amounts of sulphur! Allows: Building of firework exercising grounds',19908,18,32,0,0),(37,'Helping hands',2,'If our citizens help out a little underground instead of tanning themselves on the beach, we?ll get more raw materials and they?ll get less sunburn. There?s always a need for help down the mines, saw mills and vineyards. Allows: Overloading of resources',19908,27,34,0,0),(38,'Experiments',3,'Our scientists want to have the chance of testing their theories in practice. These trials would most probably accelerate research time, but does mean they would need a certain amount of additional laboratory equipment.',21360,35,0,0,0),(39,'Logistics',4,'Our soldiers can fight much better if they don`t have to drag that much. And their equipment will last much longer on the long marches, so we won`t have to mend it that often. Effect: 8% less upkeep for soldiers',25632,36,0,0,0),(40,'Diplomacy',1,'One of our philosophers has written down wise things about war and peace. He has advised us to confederate with other nations so that we can fight our enemies together! Allows: Garrison right',17064,32,33,0,0),(41,'Spirit Level',2,'Water is always even. We should use this knowledge so that our buildings become even, too! Our town will become even more beautiful and we will use less stone and wood for constructing our buildings! Effect: 8% less cost for the construction of buildings.',25632,37,0,0,0),(42,'Mechanical Pen',3,'A brilliant little apparatus: A smart inventor has managed to teach writing to a machine. Now we can copy our scriptures easily and our academies can quickly exchange their ideas with each other! Effect: 8% more research points',31968,38,0,0,0),(43,'Gunpowder',4,'This black mixture from the alchemist`s kitchen can spark a fire with a loud bang and do truly devilish things! Now we can build metal tubes we can fill with this powder in order to shoot heavy cannon balls through the air! Allows: Building marksmen in the barracks',38400,35,39,0,0),(44,'Sea maps',1,'Our voyages will be much safer if we write down where all the dangerous currents and treacherous shallows are! Then our seamen won`t have to be afraid of any jagged rocks, deadly maelstroms or seductive sirens any more. Effect: 8% less upkeep for ships',25632,40,0,0,0),(45,'Wine press house',2,'What an event those annual wine feasts are! The whole town is up on its feet when the best grapes are stomped into wine and when the liquid gold splashes around, the kids have their most fun! With a Wine Press though, handled by an experienced wine maker, we would lose much less. The winemaker could also care for a proper storage that allows us to let the wine age and mature well!',48000,41,0,0,0),(46,'Bird`s Flight',3,'We have learned how to fly like the birds! Now we can build a machine that can lift a man up into the skies and can whizz above the heads of our enemies with breath-taking speed, shooting arrows far behind the front lines. Allows: Gyrocopter',46848,24,42,0,0),(47,'Robotics',4,'Our scientists have built a mechanical giant with muscles made of metal and a steaming heart! Only the keenest and most skilled soldiers can steer such a colossus, but it will strike fear into everyone on the battlefield! Allows: Building of steam giants in the barracks',106560,43,0,0,0),(48,'Paddle Wheel Engine',1,'Great news for our seamen: A steam driven paddle wheel lets our ships ride much faster as they could ever do with oarsmen. Now we can teach fear to our enemies with our mighty steam rams! Allows: Building of steam rams in the shipyard',38400,27,44,0,0),(49,'Bureaucracy',2,'Now our palace has even more shelves, boxes and drawers, even more piles of records and forms and clerks who can understand it all. Finally we can afford to build and administer an additional building in our towns! Allows: An additional building space in the towns',106560,45,0,0,0),(50,'Letter chute',3,'A marvel: We can now shoot scrolls through pipes, so that they reach our scientists even faster! This saves us long errands and we have to pay less gold for our scientists! Effect: 3 Gold upkeep cost less per scientist',144720,43,37,36,33),(51,'Canon Casting',4,'Our iron is getting heavier and harder: Now we can even build barrels through which we can fire huge cannon balls at our enemies! If we can even fire bombs from a long distance our enemies and their town walls will tremble in fear! Allows: Building mortars in the barracks',209040,47,0,0,0),(52,'Mortar Attachment',1,'This mortar is so huge, that not even Hercules could drag it along. Only an armoured steam ship is strong enough to carry it and all the huge cannon balls it can fire at our enemies. Allows: Building of mortar ships in the shipyard',93240,35,48,0,0),(53,'Utopia',2,'Our citizens are living in wealth and prosperity. They are happy and healthy and have very little to worry about. Yes, one could say we are living in one of those places that you can only find in the scriptures from one of the great philosophers. Effect: +200 housing space, +200 satisfaction in the capital',241200,49,40,50,43),(54,'Militaristic Future',4,'Our war machines are stronger and mightier than ever before and our armies are perfectly organised! Our civil servants managing the military have everything under control and thus the upkeep costs can be lowered. Effect: 2% less upkeep for units',532800,51,52,53,58),(55,'Seafaring Future',1,'The secrets of the oceans are finally ours! Our ships are constantly becoming tougher and faster! There are almost no ships on this ocean capable of competing with ours. Effect: 2% less upkeep for ships',532800,52,53,58,51),(56,'Economic Future',2,'Our citizens live in wealth and the marketplace is spilling over with delicacies from all over the world! The streets are clean and developed, this way the building material reaches the building site quicker. Effect: +10 Satisfaction and +20 max citizen number in every town. Multiplied with the level of this research',532800,52,53,58,51),(57,'Pressure Chamber',3,'Now we can let our ships sail under water, without them sinking! The oceans are ours! No enemy will see us, when we stalk them under water and sink them before they notice us! Allows: Building of submersibles in the shipyard',209880,50,48,47,0),(58,'The Archimedic Principle',3,'We have managed to let a machine fly! Now even the sky isn`t a limit anymore! We can let huge balloons fly over the heads of our enemies and throw fire or bee-hives at them from above! Allows: Building of bombardiers in the barracks',444000,57,0,0,0),(59,'Scientific Future',3,'The smartest brains in the world are working to answer the big question: Why are we here? Why is everything the way it is? And once again we are one step closer to enlightenment. Effect: 2% more research points',610560,52,51,53,58);
